74	22	4	{"date_general_meeting":"26 декабря 2023 года","type_general_meeting":"Внеочередное","issues_voting_decisions_taken":"Принятые решения:\\n1. Избрать Счетную комиссию в составе: 1) Председатель Счетной комиссии: Молтоева Зарина Эркебаевна - представитель ОсОО «Registrum» («Региструм»). Члены Счетной комиссии: 2) Гунина Марина Геннадьевна; 3) Карабекова Ракат Сатынбаевна.\\n2. Одобрить совершение следующей крупной сделки (взаимосвязанных сделок):\\n1) кредитного договора между Открытым акционерным обществом «Кантский цементный завод» (далее – «КЦЗ») в качестве заемщика и Евразийским банком развития в качестве кредитора по предоставлению денежных средств (кредитной линии) заемщику в соответствии с существенными условиями, изложенными в протоколе внеочередного общего собрания акционеров КЦЗ от 26 декабря 2023 года;\\n2) для обеспечения исполнения кредитных обязательств КЦЗ:\\n2.1) между КЦЗ в качестве залогодателя и Евразийским банком развития в качестве залогодержателя по залогу имущества КЦЗ для обеспечения исполнения кредитных обязательств КЦЗ, включая:\\n- залог (ипотеку) предприятия как имущественного комплекса КЦЗ (движимое и недвижимое имущество (или без недвижимого имущества) и имущественные права, а также любое имущество (права на него), которое будет принадлежать КЦЗ в будущем); и/или\\n- залог недвижимого имущества КЦЗ (в том числе прав временного пользования (аренды) земельными участками и имущества, которое будет принадлежать КЦЗ в будущем), а также соглашение о внесудебном порядке обращения взыскания на заложенное имущество (имущественный комплекс) КЦЗ; \\n- залог движимого имущества КЦЗ (в том числе имущество, которое будет принадлежать КЦЗ в будущем);\\n2.2) между КЦЗ и Евразийским банком развития (в качестве бенефициара) и банками, в которых открыты счета КЦЗ, по списанию денежных средств с соответствующих счетов с заранее данным распоряжением (акцептом) КЦЗ, включая договоры прямого дебетования денежных средств со счетов КЦЗ.\\nГенеральному директору Открытого акционерного общества «Кантский цементный завод» заключить соответствующие договоры, дополнительные соглашения, а также уполномочить его на совершение иных действий и подписание иных документов, необходимых для исполнения настоящего решения, включая проведение инвентаризации имущества КЦЗ, осуществление независимой оценки имущества КЦЗ.\\n"}	2023-12-29 04:22:27.186+00	2023-12-29 04:41:02.038+00	131	145	2023-12-29 04:11:56.936+00	2023-12-29 04:41:02.04+00
